package fx.backend.domain;import jakarta.persistence.*;import lombok.Data;import java.time.LocalDateTime;@Data@Entitypublic class Orders {    @Id @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long ID;    private String name;    private Integer quantity;    private String phoneNumber;    private String bankName;    private OrderStatus status = OrderStatus.WAITING;    @Column(name = "created_at", insertable = false)    @Temporal(TemporalType.TIMESTAMP)    private LocalDateTime createdAt;    public Orders() {    }    public Orders(String name, Integer quantity, String phoneNumber, String bankName) {        this.name = name;        this.quantity = quantity;        this.phoneNumber = phoneNumber;        this.bankName = bankName;    }}